async function getdata() {
  let response = await fetch('https://kontests.net/api/v1/all');
  then((response) => response.json())
  then((responseJson) => {
    return responseJson;
  })
  .catch((error) => {
    console.log(error);
  });
}

function App() {
  var text = "ho";
  const data = getdata();
  console.log(data);
  /*for(var info in data)
  {
    text = text + info + " ";

  }*/
  return text;
}

export default App;
